<script>
$('#env-select').on('change', function(e){
        var source = $(this),
            val = $.trim(source.val()),
            target = $('#channelblock');
      $(target).empty();
        if(typeof(_data[val]) != "undefined"){
            var options = (typeof(_data[val]) != "undefined") ? _data[val] : {};
            $.each( options , function(value,key) {
                    $('<li class="list-group-item li" style="text-align:left;"><i class="fa fa-play-circle"></i> &nbsp;'+ key +'</li>').appendTo(target);
            });
        }
 
    });
    
</script>
<script>
function myFunction() {
    var input, filter, ul, li, i, txtValue;
    input = document.getElementById("searchChaine");
    filter = input.value.toUpperCase();
    ul = document.getElementById("channelblock");
    li = ul.getElementsByTagName("li");
    for (i = 0; i < li.length; i++) {
        txtValue = li[i].textContent;
        if (txtValue.toUpperCase().indexOf(filter) > -1) {
            li[i].style.display = "";
        } else {
            li[i].style.display = "none";
        }
    }
}
</script>
